<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Khaz Modan Expedition — Countdown</title>
  <meta name="description" content="Live countdown to the Khaz Modan Expedition. Nov 1, 2025 · 5:30 PM Pacific."/>
  <link href="https://fonts.googleapis.com/css2?family=Cinzel:wght@700;900&display=swap" rel="stylesheet">
  <style>
    :root{ --ink:#e6edf6; --muted:#a9b6cc; --bg:#020611; }
    html,body{height:100%}
    body{margin:0; font-family: system-ui,-apple-system,Segoe UI,Roboto,Ubuntu,Helvetica,Arial; color:var(--ink); background:#020611}
    .stage{ position:relative; min-height:100vh; display:grid; place-items:center; overflow:hidden; }
    .bg{ position:fixed; inset:0; width:100%; height:100%; object-fit:cover; object-position: 50% 56%; z-index:0; }
    .shade-top{ position:fixed; inset:0; background: linear-gradient(to bottom, rgba(2,6,17,.55), rgba(2,6,17,.22), rgba(2,6,17,0)); z-index:1; }
    .shade-bot{ position:fixed; inset:0; background: linear-gradient(to top, rgba(2,6,17,.82), rgba(2,6,17,.46), rgba(2,6,17,.12), rgba(2,6,17,0)); z-index:1; }

    .topbar{
      position:fixed; top:0; left:0; right:0; z-index:2;
      padding: clamp(12px, 3vw, 22px) clamp(12px, 4vw, 28px);
      text-align:center;
    }
    .title{ font-family:'Cinzel',serif; font-weight:900; font-size: clamp(1.2rem, 5vw, 2.4rem); letter-spacing:.06em;
            margin:0 0 .2rem 0; text-shadow:0 6px 28px rgba(0,0,0,.65) }
    .subtitle{ font-family:'Cinzel',serif; font-weight:700; font-size: clamp(.95rem, 2.8vw, 1.2rem); letter-spacing:.12em;
               color:#d6e1f8; opacity:.98; margin:0 }

    /* Countdown moved to ~12.5% from the bottom */
    .bottombar{
      position:fixed; bottom:12.5vh; left:0; right:0; z-index:2;
      padding: clamp(10px, 3vw, 18px) clamp(12px, 4vw, 28px);
      display:flex; justify-content:center;
      background: linear-gradient(to top, rgba(2,6,17,.50), rgba(2,6,17,.24), rgba(2,6,17,0));
      border-radius: 16px;
    }
    .timer{ display:flex; gap:.5rem; flex-wrap:wrap; justify-content:center }
    .tbox{ min-width: clamp(56px, 9vw, 96px); padding:.42rem .55rem; border-radius:14px;
           background: rgba(0,0,0,.50); border:1px solid rgba(255,255,255,.16);
           backdrop-filter: blur(4px); box-shadow: 0 6px 18px rgba(0,0,0,.45) }
    .num{ font-variant-numeric: tabular-nums; font-weight:800; font-size: clamp(1rem, 3.4vw, 1.3rem); line-height:1 }
    .lbl{ margin-top:.06rem; font-size:.64rem; letter-spacing:.18em; text-transform:uppercase; color:#cfd8ea; opacity:.85 }

    @media (max-width: 420px){
      .bottombar{ bottom: 11vh; } /* tiny phones: halfway between 22vh and 0 */
      .num{ font-size: 1rem; }
      .tbox{ min-width: 54px; padding:.38rem .48rem; }
    }
  </style>
</head>

    <div class="topbar">
      <h1 class="title">Khaz Modan Expedition</h1>
      <div class="subtitle">The Mist Awaits</div>
    </div>

    <div class="bottombar">
      <div class="timer" id="timer" aria-label="Countdown to November 1, 2025, 5:30 PM Pacific"></div>
    </div>
  </div>

  <script>
    const target = new Date('2025-11-01T17:30:00-07:00');
    const parts = [ ['days','Days'], ['hours','Hours'], ['minutes','Minutes'], ['seconds','Seconds'] ];
    const timerEl = document.getElementById('timer');
    const boxes = {};
    for(const [key,label] of parts){
      const box = document.createElement('div'); box.className='tbox';
      box.innerHTML = `<div class="num" id="num-${key}">00</div><div class="lbl">${label}</div>`;
      timerEl.appendChild(box); boxes[key] = box.querySelector('.num');
    }
    const pad = n => String(n).padStart(2,'0');
    function tick(){
      const now = new Date();
      const ms = Math.max(0, target - now);
      const s = Math.floor(ms/1000);
      const d = Math.floor(s/86400);
      const h = Math.floor((s%86400)/3600);
      const m = Math.floor((s%3600)/60);
      const sec = s%60;
      boxes.days.textContent = d;
      boxes.hours.textContent = pad(h);
      boxes.minutes.textContent = pad(m);
      boxes.seconds.textContent = pad(sec);
    }
    setInterval(tick, 1000); tick();
  </script>
